<script>
import VueLottie from "vue-lottie";
import LottieVehicle from "@/assets/Lottiehealth.json";
export default {
  components: {  VueLottie },
  data() {
    return {
      isDivVisible: false,
      showDetails: {
        Bronze: false,
        Silver: false,
        Gold: false
      },
      show: false,
      vehicleForm: false,
      showSecurity:false,
      coverType: '',
      defaultOptions: {
        animationData: LottieVehicle,
        renderer: 'svg', // Ensure vue-lottie renders as SVG
        loop: true,
        autoplay: true
      },
    }
  },
  mounted() {
    console.log('Component mounted!');
    window.addEventListener('scroll', this.handleScroll, true);
    this.adjustViewBox()

  },
  beforeDestroy() {
    window.removeEventListener('scroll', this.handleScroll);
  },
  methods: {
    handleScroll() {
      if (!this.isScrolling) {
        console.log('Scroll initiated!');
        this.isScrolling = true;

        this.isDivVisible = true;
      }
      const scrollY =
          window.scrollY || document.body.scrollTop || document.documentElement.scrollTop;
      console.log('Scroll Position:', scrollY);
      this.isDivVisible = scrollY > 2;
    },
    adjustViewBox() {
      const div2 = document.querySelector('.overlap-div.div2');

// Find the SVG element inside the div
      const svg = div2.querySelector('svg');

// Modify the viewBox attribute of the SVG
      svg.setAttribute('viewBox', '0 -160 1000 650');
    }
  },
}
</script>

